import React, { Component } from 'react'
import UserElement from '../UserElement'
import './index.css'

export default class List extends Component {

    
    render() {
        return (
            <div className="row">
                {
                    this.props.userList.map(user => {
                        return (<UserElement key={user.id} {...user}/>)
                    })
                }
            </div>
        )
    }
}
